package tests.generator.blockLambda

fun f1(param: (a: Int, b: Int) -> r: Int)
fun f2(param: () -> ())

fun g() -> a: Int

pipeline test {
    f1((a: Int, b: Int = 2) {
        yield d = g();
    });
    f1((a: Int, c: Int) {
        yield d = g();
    });
    f2(() {});
}
